INSERT INTO `likes`.`inf_sysnotice` (`type`, `accno`, `title`, `notebody`, `en_notice`, `sp_notice`, `ab_notice`, `fn_notice`, `vi_notice`, `params`, `expirydates`, `expirydatee`, `sortby`, `work_status`, `is_delete`, `create_user`, `create_time`, `update_user`, `update_time`) VALUES ('1', '', 'app顶部轮播文字', '', 'Xin chào  tất cả mọi người đang sử dụng nền tảng của chúng tôi.Mọi người có thể kiếm thêm thu nhập bằng cách mời bạn bè tham gia vào nền tảng\n\n', 'Los agentes internacionales dejarán de dar vip1 gratis a las 00:00 del 15 de junio, hora de México', 'سيتوقف الوكلاء الدوليون عن منح vip1 مجانًا في الساعة 00:00 يوم 15 يونيو بتوقيت المكسيك', 'Les agents internationaux cesseront de donner gratuitement vip1 à 00h00 le 15 juin, heure du Mexique', '', '', NULL, NULL, '0', b'1', b'0', 'a3e5bb5fa2fe429f9f2677efb8316bf6', '2022-05-24 23:05:43', '28883d4a8d584128a9443111ac0c93fe', '2022-05-24 23:21:03');
INSERT INTO `likes`.`inf_sysnotice` (`type`, `accno`, `title`, `notebody`, `en_notice`, `sp_notice`, `ab_notice`, `fn_notice`, `vi_notice`, `params`, `expirydates`, `expirydatee`, `sortby`, `work_status`, `is_delete`, `create_user`, `create_time`, `update_user`, `update_time`) VALUES ('2', '', 'app首页启动公告', '', 'Xin chào tất cả mọi người .kênh mua hàng VIP đã chính thức được mở ! VIP1-VIP5 đã được khởi chạy thành công.', 'Estimados usuarios: El primer concurso internacional de agencias del 15 de mayo al 15 de agosto\nOrganizador: Smart Part-Time Unidad participante: Agente internacional\n    Premio Campeón: $1,280,000\n    El bono de finalista 680000USDT\n    Tercer Premio: $380,000\n  4-10 Bono $120,000 USD\n  11-30 Bono $60,000\n30-100 bono de $30,000\n\nLos agentes internacionales dejarán de regalar VIP1 a las 00:00 horas del 15 de junio, hora de México\nAl mismo tiempo, Smart Part-Time dejará de emitir el bono de invitación de $20 y abrirá el canal de compra VIP4 el 15 de junio.\nEstén atentos para más anuncios oficiales\n', 'علان: مسابقة الوكالة الدولية الأولى 15 مايو - 15 أغسطس\nالمنظم: الوحدات المشاركة الذكية بدوام جزئي: الوكلاء الدوليون\n    البطل باونتي 1280000USDT\n    الجائزة الثانية 680000 دولار أمريكي\n    الجائزة الثالثة 380000 دولارًا أمريكيًا\n  4-10 مكافأة نقدية 120000 دولارًا أمريكيًا\n  11-30 مكافأة 60000 دولارًا أمريكيًا\n30-100 مكافأة نقدية 30000 دولارًا أمريكيًا\n\nسيتوقف الوكلاء الدوليون عن تقديم VIP1 مجانًا في تمام الساعة 00:00 يوم 15 يونيو بتوقيت المكسيك\nفي الوقت نفسه ، سيفتح Smart Part-Time قناة شراء VIP4!\nترقبوا المزيد من الإعلانات الرسمية', 'Chers utilisateurs : Le premier concours international d\'agences du 15 mai au 15 août\nOrganisateur : Unité participante intelligente à temps partiel : Agent international\n    Prix ​​des champions : 1 280 000 $\n    Le bonus finaliste 680000USDT\n    Troisième prix : 380 000 $\n  Prime 4-10 120 000 $\n  11-30 Prime 60 000 $\nPrime 30-100 30 000 $\n\nLes agents internationaux cesseront de distribuer VIP1 à 00h00 le 15 juin, heure du Mexique\nDans le même temps, Smart Part-Time cessera d\'émettre un bonus d\'invitation de 20 $ le 15 juin et ouvrira le canal d\'achat VIP4.\nRestez à l\'écoute pour plus d\'annonces officielles', '', '', NULL, NULL, '2', b'1', b'0', 'a3e5bb5fa2fe429f9f2677efb8316bf6', '2022-05-24 23:06:14', '28883d4a8d584128a9443111ac0c93fe', '2022-12-22 01:14:51');
